subSubSection.paragraph:
DIAGNOSIS: This species differs from others by its very large size (TBL> 
3.5 mm
), clavate antennae (antennomeres 5–11 gradually widening) (fig. 4), unmodified male metafemur (without teeth) and very distinctive median lobe which is long, slender, irregularly sinuate, and has the apex bifid in ventral aspect (figs. 37, 38).

DESCRIPTION: Body very large (TBL = 
3.77–4.14 mm
), broad (PNW/TBL = 0.53– 0.55), laterally broadly rounded, somewhat contractile.

